def _cython_agg_blocks(self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []

    for block in data.blocks:
        result, new_items, agg_block = self._handle_block(block, how, alt, self.grouper, self.obj, self.axis, min_count)
        if result is not no_result:
            new_items = self._process_result(result, block, agg_block, new_items, agg_blocks)

    if not (agg_blocks or split_frames):
        raise DataError("No numeric types to aggregate")

    if split_items:
        self._clean_up_split_blocks(split_items, agg_blocks)

    self._reset_locs_in_blocks(agg_blocks, new_items, data)

    return agg_blocks, data.items.take(np.sort(np.concatenate(new_items)))
